--
-- Table structure for table `expenditure`
--

DROP TABLE IF EXISTS `expenditure`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `expenditure` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '支出名目',
  `remarks` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '备注',
  `type_id` int(10) unsigned NOT NULL COMMENT '类别',
  `shop_id` int(10) unsigned DEFAULT NULL COMMENT '所用店铺',
  `amount` decimal(6,2) NOT NULL COMMENT '金额',
  `paydate` date NOT NULL COMMENT '支付日期',
  `was_paid` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否已付清',
  `has_receipt` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否有凭据',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `expenditure_shop_id_foreign` (`shop_id`),
  KEY `expenditure_type_id_foreign` (`type_id`),
  CONSTRAINT `expenditure_shop_id_foreign` FOREIGN KEY (`shop_id`) REFERENCES `shop` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `expenditure_type_id_foreign` FOREIGN KEY (`type_id`) REFERENCES `expenses_type` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=53 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

